import {
  Button,
  Grid,
  Stack,
  useTheme,
  useMediaQuery,
  Typography,
} from "@mui/material";

export const Profile = () => {
  const theme = useTheme();
  const matches = useMediaQuery(theme.breakpoints.up("md"));
  const widthCalc = `calc(100vw - ${matches ? "200" : "75"}px)`;
  return (
    <Grid
      width={widthCalc}
      justifyContent={"center"}
      alignItems={"center"}
      container
    >
      <Grid
        sm={8}
        item
        container
        justifyContent={"space-between"}
        direction={"row"}
        spacing={3}
      >
        <Grid sm={4} item>
          <svg>
            <circle cx={"50%"} cy={"50%"} r={"75px"} fill={"#2196f3"} />
          </svg>
        </Grid>
        <Grid sm={5} item>
          <Stack direction="column">
            <Typography color={"#fff"} variant={"h4"}>
              Dr. Stephen Strange
            </Typography>
            <Typography color={"#ddd"} variant={"subtitle1"}>
              @drstrange
            </Typography>
          </Stack>
        </Grid>
        <Grid sm={2} item>
          <Button color={"primary"} variant="outlined">
            Edit Profile
          </Button>
        </Grid>
      </Grid>
      <Grid sm={4} item container justifyContent={"center"}>
        <Button>Right Nav</Button>
      </Grid>
    </Grid>
  );
};
